import React from 'react'; 

const SearchResults = ({items, setModal}) => {


    if(!items){
        return null
    }
    else{
    return(
            items.map( (item, i) =>
            <tr key={item.id} id={item.id} onClick={(e) => {this.setModal(e.target)}}>
                <th scope="row">{i + 1}</th>
                <td> 
                <p key={i}>{item.name}</p>
                </td>
                <td> <p>{item.forks_count}</p></td>
            </tr>
            )

    )
    }
}

export default SearchResults ;
